import React from 'react'

export default function Contact(){
    return (
        <form className="card">
            <img src="" alt="" />
            <input type="text" placeholder='שם'/>
            <input type="text" placeholder='אימייל' />
            <button className="cta">שליחה</button>
        </form>
    )
}
